import React from 'react';

interface data {
    username : string;
    role :string;
}

export default class Welcome extends React.Component<data> {

    constructor(props: data){
        super(props);
        this.state ={
            username: '',
            role: '',
        }


    }
    render(){
        return(
            <>
            <div className="logoo"> 
                <span>
                    Welcome {this.state.loggedInUser?.firstname}
                </span>
                <span>
                    your current roll is {this.state.loggedInUser?.role}
                </span> 
                </div>
            </>
        )
    }
}
